import React from "react";
import { Jumbotron, Button, Container } from "reactstrap";
import BlogCard from "../Templates/BlogCard";

const Home = () => {
  const obj = {
    title: "Avengers",
    subtitle: "EndGame",
    description: "Love You 3000",
  };
  return (
    <React.Fragment>
      <br />
      <br />
      <br />
      <Container>
        <BlogCard
          title="Avengers"
          subtitle="EndGame"
          description="Love you 3000"
          media="https://picsum.photos/200/300"
          userName = ""
        />
      </Container>
    </React.Fragment>
  );
};

export default Home;
